function Movie() {

  return (
    <div className="movie">
      <iframe width="969" height="545" src="https://www.youtube.com/embed/RrUQYiJt3HQ" title="2020樂享大師國際音樂營—精華片段" frameBorder="0" allow="accelerometer; autoplay; clipboard-write; encrypted-media; gyroscope; picture-in-picture" allowFullScreen></iframe>
    </div>
  );
};

export default Movie;
